import part1 from "./ServicesIMG/part1.png";
import part2 from "./ServicesIMG/part2.png";
import part3 from "./ServicesIMG/part3.png";
import part4 from "./ServicesIMG/part4.png";
import part5 from "./ServicesIMG/part5.png";
import part6 from "./ServicesIMG/part6.png";

const ServicesData = [
  {
    id: 1,
    imgUrl: part1,
  },
  {
    id: 2,
    imgUrl: part2,
  },
  {
    id: 3,
    imgUrl: part3,
  },
  {
    id: 4,
    imgUrl: part4,
  },
  {
    id: 5,
    imgUrl: part5,
  },
  {
    id: 6,
    imgUrl: part6,
  },
];
export default ServicesData;
